    a discrepancy in the reporting of a debt.  The Committee has reviewed the debt
    schedule and corrected the discrepancy.  In addition, it was discovered that due
    to a miscommunication the Committee inadvertently left off a Memo in-kind of Voter
    File to a federal candidate - this amendment corrects that as well.  All subsequent
    reports are being amended to reflect the changes made to the debt schedule.  Please
    note that the employees that were disclosed on Schedule H4 supporting Line 21
    and Schedule B supporting Line 21(b) as payroll spent less than 25% of their time
